import React from "react";
import List from "../models/List.js"
import Model from "../models/Model.js"
export default class Data extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            list:new List(props.list),
            model:new Model({
                results:props.results,
                state:props.state,
                date:props.date,
                cases:props.cases,
                deaths:props.deaths
            }).toString()
        }
    }

    render() {
        return(
            <div className="Results">
                <div className="row">
                    <div className="col-lg-12">
                        <this.state.model />
                    </div>
                </div>
            </div>
        )
    }
}
